import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import HomePage from './containers/Home';

function App() {
  return (
    <div className="App">
        <Router>
            <Route exact path="/" component={HomePage} />
        </Router>
    </div>
  );
}

export default App;
